import React from 'react';
import { ReactDOM } from 'react-dom';
import homeProfileImg from './home-imgs/home-profile-img.JPG';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
// import { Switch } from 'react-router';
// import './App.css';
// import { ImageGroup } from 'semantic-ui-react';
import './NavBar.css';
import './Footer.css';
import ResumePage from './ResumePage.js';
import NewPage from './NewPage';
import Home from './Pages/Home';



function App() {
  return (
    <Router>
    <nav className="navigation-bar">
            <div className='left-nav'>
              <div className='tiny-circle'></div>
              <span className='myName'><Link to="/">Loveleen Bassi</Link></span>
              <span className='myJob'> Developer</span>

            </div>
            <div className='right-nav'>
              <span className='nav-links'><Link to="./ResumePage">Resume</Link></span>
              <span className='nav-links'><a>Projects</a></span>
              <span className='nav-links'><a>Contact</a></span>
            </div>
          </nav>

    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/new-page" element={<NewPage />} />
      <Route path='/ResumePage' element={<ResumePage />} />
      <Route />
    </Routes>
    <footer className='footer-container'>
      <table className='footer-table'>
        <tbody>
          <tr className='first-row'>
            <td className='first-col'>Phone</td>
            <td className='sec-col'> Email</td>
            <td className=''>Follow Me</td>
            <td>&copy; 2023 By Loveleen Bassi <br/>Coded by Loveleen Bassi</td>
          </tr>
          <tr className='second-row'>
            <td>hello</td>
            <td> seconf</td>
            <td>third</td>
            {/* <td>last</td> */}
          </tr>
        </tbody>
      </table>
    </footer>
  </Router>
  );

}

export default App;
